import {Navbar, Container, Nav, NavDropdown} from "react-bootstrap"
import BottomNav from "../BottomNav/BottomNav";
export default function Header ({category1,category2,category3}) {

  const handleClick = () => {
    alert("Este boton fue clickeado")
  }
  const Button = ({texto}) => {
    console.log(texto)
    return (
      <input type="button" value={texto}/>
    )
  }
  return (
    <>
      <Navbar bg="light" expand="lg">
        <Container>
          <Navbar.Brand href="#home">React-Bootstrap</Navbar.Brand>
          <Navbar.Toggle aria-controls="basic-navbar-nav" />
          <Navbar.Collapse
            id="basic-navbar-nav"
            className="justify-content-end"
          >
            <Nav>
              <Nav.Link href="#home">Inicio</Nav.Link>
              <Nav.Link href="#link">{category1}</Nav.Link>
              <Nav.Link href="#link">{category2}</Nav.Link>
              <Nav.Link href="#link">{category3}</Nav.Link>
            </Nav>
          </Navbar.Collapse>
        </Container>
      </Navbar>
      <BottomNav />
      <Button texto="CLICKEAME"  onClick={handleClick} />
      <Button texto="CLICKEAME2" onClick={handleClick} />
      <Button texto="CLICKEAME3" onClick={handleClick} />
      <Button texto="CLICKEAME4" onClick={handleClick} />
      <Button texto="CLICKEAME5" onClick={handleClick} />
    </>
  );
}
